DROP PROCEDURE IF EXISTS `uspGetAllUsers`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `uspGetAllUsers` ()  NO SQL
select * 
from user 
where user.active = 'Y' and user.role = 'U'$$

DROP PROCEDURE IF EXISTS `uspGetUserDetails`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `uspGetUserDetails` (IN `userid` INT(11))  NO SQL
select * 
from user
where user.userid = userid$$

DROP PROCEDURE IF EXISTS `uspRegister`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `uspRegister` (IN `firstname` TEXT, IN `lastname` TEXT, IN `pass` CHAR(64), IN `email` VARCHAR(320), IN `userid` VARCHAR(11), IN `picture` LONGBLOB)  NO SQL
INSERT INTO user 
		   (user.userid, user.firstname, user.lastname,
           user.password, user.email, user.active, user.role, user.picture)
VALUES (userid, firstname, lastname, pass, email, 'Y', 'U', picture)$$

DROP PROCEDURE IF EXISTS `uspSignIn`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSignIn` (IN `email` VARCHAR(320), IN `pass` INT(64))  NO SQL
SELECT * 
FROM user
WHERE user.email = email
      and 
      user.password = pass
      and 
      user.active = 'Y'$$

